import Link from 'next/link';

const navStyle = {
  textAlign: 'right',
  position: 'relative',
  top: '-1.7em'
  // marginTop: '10%',

};
const linkStyle = {
  margin: '75px',
  textDecoration: 'none',
  color: 'black'
};
const imgStyle = {
  height: '10%',
  textAlign: 'left',
  display: 'block',
  marginLeft: '10px',
  // marginRight: 'auto',
  width: '25%'
}
const appStyle = {
  textAlight: 'center' ,
  fontSize: '2em',
  fontFamily: '"Arial Black", Gadget, sans-serif'
}

const Header = () => (
  <div style={appStyle}>
    <img src="/dkp.png" style={imgStyle}/>
    <div style={navStyle}> 
      <Link href="/">
        <a style={linkStyle}>Home</a>
      </Link>
      <Link href="/about">
        <a style={linkStyle}>About</a>
      </Link>
      <Link href="/events">
        <a style={linkStyle}>Event Calendar</a>
      </Link>
      <Link href="https://www.honeybook.com/widget/dkp_entertainment/cf_id/5a76e184dc145200031219c4">
        <a style={linkStyle}>Contact Us</a>
      </Link>
    </div>
  </div>
);

export default Header;
